import httpx, os
from colorama import Fore

os.system("cls")
guild_id = input("guild id: ")

for token in open("tokens.txt","r+").read().splitlines():
    try:
        headers = {
            "accept": "*/*",
            "accept-encoding": "gzip, deflate, br",
            "accept-language": "en-US,en;q=0.9",
            "authorization": token,
            "referer": "https://discord.com/channels/@me",
            "sec-fetch-dest": "empty",
            "sec-fetch-mode": "cors",
            "sec-fetch-site": "same-origin",
            "user-agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.5112.81 Safari/537.36 Edg/104.0.1293.47",
            "x-debug-options": "bugReporterEnabled",
            "x-discord-locale": "en-US",
            "x-super-properties": ""
        }
        r = httpx.get(f"https://discord.com/api/v9/guilds/{guild_id}",headers=headers)
        if r.status_code == 200:
            print(f"{Fore.GREEN}Succes on {token.split('.')[0]}")
            with open("checked.txt","a+") as e: 
                e.write(token+"\n")

        else:
            print(f"{Fore.RED}Fail on {token.split('.')[0]} "+r.text)

    except Exception as e:
        print(f"{Fore.RED}Fail on {token.split('.')[0]} "+str(e))